import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

/*Componentes*/
import Footer from './componentes/Footer';



import * as serviceWorker from './serviceWorker';


ReactDOM.render(
  <React.StrictMode>
    <Footer />
  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();
